import { useEffect, useState } from "react";
import "./App.css";
import { BrowserRouter as Router,Routes,Link } from "react-router-dom";
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import fetcher from "./common/movies";

function App() {

  const [Movies,setMovies] = useState({});
  let moviesArr = [];
  useEffect(() => {
    const fetchMovies = async() => {
      moviesArr =  await fetcher.get(`?apikey=e8960dea&s=harry`);
      setMovies(moviesArr);
    }
    fetchMovies();
  }, []);



  return (
    <div className='App'>
      <Router>

        <Header></Header>

        {moviesArr.data.Search.map((movie) => {
          <h4>{movie.Title}</h4>
        })}

        <Footer></Footer>

      </Router>
    </div>
  );
}

export default App;
